import React, { Component} from 'react';

class InfoSection extends Component {
	constructor() {
		super()
		this.state = {
			infos: "test"
		}
	}
	render() {
		return (
			<div className="info-section">
				<h2>{this.props.title}</h2>
				{this.props.children}
			</div>
		);
	}
}

export default InfoSection;
